import React from 'react';

class Header extends React.Component {
    render() {
        return (
            <header className="top">
                <h1>Catch 
                    <div className="ofThe">
                        <div className="of">of</div>
                        <div className="the">the</div>
                    </div>
                    Day</h1>

                <h3 className="tagline">
                    <span>Fresh Seafood Market</span>
                </h3>
            </header>
        );
    }
}

export default Header;
